import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import { AuthProvider, useAuth } from './context/AuthContext';

import Layout from './components/Layout';
import ProtectedRoute from './components/ProtectedRoute';
import LoginPage from './pages/LoginPage';
import StoreListPage from './pages/StoreListPage';
import UserListPage from './pages/UserListPage'; // Import the new page

// A simple dashboard home page
const DashboardPage = () => <h2>Dashboard Home</h2>;

function App() {
  return (
    <AuthProvider>
      <Router>
        <div className="App" style={{ padding: '20px' }}>
          <h1>Prowtech Admin Dashboard</h1>
          <Routes>
            <Route path="/login" element={<LoginPage />} />

            <Route path="/" element={<ProtectedRoute><Layout /></ProtectedRoute>}>
              <Route index element={<DashboardPage />} />
              <Route path="stores" element={<StoreListPage />} />
              <Route path="users" element={<UserListPage />} /> {/* Add this route */}
            </Route>
          </Routes>
        </div>
      </Router>
    </AuthProvider>
  );
}

export default App;
